import React from "react";

const UserProfile = ({image, name , title}) => {
    return (
        <div>

            <div className="box">
            <img src={image} alt="" />
            <h1>{name}</h1>
            <h1>{title}</h1>
            </div>

        </div>

    )
}

export default UserProfile
